// import { useState, useEffect } from 'react'
import './App.css';


function getExper(stlvl,endlvl,type){
  fetch('/exp/'+stlvl+'/'+endlvl+'/'+type)
  .then(response => response.json())
  .then(data => console.log(data));
}

function App() {

  return (
    <div className="App">

    <button onClick={getExper}>

         Get Exp
      </button>
    </div>
  );
}

export default App;
